import logo from './img/Azakana_logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Bienvenue sur Azakana !
        </p>
      </header>
    </div>
  );
}

export default App;
